import React from 'react';

const styles = {
  container: {
    display: 'flex',
    minHeight: '100vh',
    fontFamily: 'Arial, sans-serif',
    backgroundColor: '#000000', // Black background
  },
  leftPanel: {
    flex: 2,
    color: 'white',
    padding: '20px',
    textAlign: 'center',
  },
  rightPanel: {
    flex: 1,
    backgroundImage: 'url("./1.jpg")', // Use the image as background
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },
  header: {
    marginBottom: '20px',
  },
  link: {
    color: '#61dafb',
    textDecoration: 'none',
  },
};

function About() {
  return (
    <div style={styles.container}>
      <div style={styles.leftPanel}>
        <header style={styles.header}>
          <h2>About the Project</h2>
          <p>
            Smart Dermatology is a web application designed to assist users in identifying 
            potential skin conditions by analyzing uploaded images.
          </p>
          <h2>About the Dataset</h2>
          <p>
            Dataset Source: <a href="https://www.kaggle.com/datasets/riyaelizashaju/skin-disease-classification-image-dataset" target="_blank" rel="noopener noreferrer" style={styles.link}>
              Kaggle - Skin Disease Classification Image Dataset
            </a>
          </p>
        </header>
      </div>
      <div style={styles.rightPanel}></div>
    </div>
  );
}

export default About;
